import React from "react";


class Login extends React.Component{
    render(){
        return(
            <form>
                <label>
                    <p>Email</p>
                    <input type="text"/>
                </label>
                <label>
                    <p>Password</p>
                    <input />
                </label>
            </form>
        )
    }
}

export default Login
